export default function CustomerCouponsSidebar(){

    return(
        <div>
            <div><button title="All Coupons">All Coupons</button></div>
            <div><button title="Coupons By Category">Search Category</button></div>
            <div><button title="All Coupons">Search Price</button></div>
        </div>
    )
}
